import React, {Component} from 'react';
import {Link} from 'react-router-dom';

import '../../css/Nav.scss';

class Nav extends Component {

    render() {
        return (
            <div className="nav">
                <div className="nav-container nav-border">
                    <img className="nav-profile-img" src={this.props.userInfo.photoURL}/>
                    <div>{this.props.userInfo.displayName}</div>
                    <div>{this.props.userInfo.email}</div>
                </div>
                <div className="nav-container nav-border">
                    <Link to="/list">
                        <div>마이페이지</div>
                    </Link>
                </div>
                <div className="nav-container">
                    <Link to="/logout">
                        <div>로그아웃</div>
                    </Link>
                </div>
            </div>
        )
    }
}

export default Nav;
